github: "https://github.com/rickkwang"
figure_id: "FIG 1.0"
figure_label: "TOPOLOGY"
figure_src: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/e1/Small-world-network-example.png/440px-Small-world-network-example.png"
